function R = solver_pnp_cayley(M)

    sols = solver_opt_pnp_nakanoC(M);
    sols = sols(:, any(not(imag(sols))));
    
    R = zeros(3,3,size(sols,2));
    for i = 1:size(sols,2)
        q = [1
             sols(:,i)];
        R(:,:,i) = quat2rot( q/norm(q) );
    end

end

